import React, { useState } from 'react';
import { useSelector } from 'react-redux';
import { selectUserHourlyWage } from '../userInputForm/userInputSlice';

function BudgetComponent() {
  const [userHourlyWage, setUserHourlyWage] = useState(null);
  setUserHourlyWage(useSelector(selectUserHourlyWage));

  return (
    <div>
      budget component return here

      <div>
        50% lving costs/needs is
        {userHourlyWage}
      </div>
      <div>30% wants</div>
      <div>20% savints</div>

      <div>portfolio strategy</div>
      <div>60% safe stable long term investing</div>
      <div>35% volotile investment business</div>
      <div>5% risky investment gamling</div>
      <div />
    </div>
  );
}

export default BudgetComponent;
